/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var subarraySum = function(nums, k) {
    // return subarraySumBruteForce(nums, k);
    return subarraySumBruteForce2(nums, k, 0);
};


/*
    minimize ∑x[i] i:1->nums.length
    such that ∑x[i].nums[i] = S
*/
var subarraySumBruteForce = function(nums, k) {
    var numTimes = 0;

    for (var i = 0; i < nums.length; ++i) {
        if (nums[i] == k)
            numTimes++;
        var sum = nums[i];
        for (var j = i + 1; j < nums.length; ++j) {
            sum = sum + nums[j];
            if (sum == k)
                numTimes++;
        }
    }
    return numTimes;
}



/*
    minimize ∑x[i] i:1->nums.length
    such that ∑x[i].nums[i] = S
    Use backtracking to check which combination {x[1], x[2] ...  x[nums.length]} = S
    Max frequency x[i] = S/nums[i];
*/
var subarraySumBruteForce2 = function(nums, k, idx) {
    console.table({ amount: k, idx: idx });
    if (k == 0)
        return 0;
    if (idx < nums.length && k > 0) {
        minCost = Infinity;
        selectedIdxMax = k / nums[idx];
        for (var i = 0; i <= selectedIdxMax; ++i) {
            result = subarraySumBruteForce2(nums, k - (nums[idx] * i), idx + 1);
            if (result > -1)
                minCost = Math.min(result + i, minCost);
            console.table({
                i: i,
                result: result,
                amount: k - (nums[idx] * i),
                idx: idx + 1
            });
        }
        return minCost != Infinity ? minCost : -1;

    } else
        return -1;
}


